features.script:
feature.on('click', e=>{
  let c4=parcel.createFeature('youtube')
  c4.set({position:[0.6,4.45,-6.45]})
c4.set({scale:[8.1,4.05,0]})
c4.set({rotation:[0,3.15,0]})
c4.set({rolloffFactor:.1})
c4.set({'url':"https://www.youtube.com/watch?v=d8Oc90QevaI"})
c4.play()
console.log("Clicked")
  })
